import React, { useEffect } from 'react';

function Graphh(props) {
    
    useEffect(()=>{

        console.log(props.data.data.hcl)
    })
    
    const loopData = (hcl) => {
        var array = [];
        hcl.map((data, i) => {
            // il nous faut l'interface
            array.push({ open : data.Open[i], closed: data.Close[i]})
            
        })
        console.log(array);
    }
    // console.log(new Date(props.data.data.hcl.opentime[0]))
    // console.log(props);

    return (
        <div>
        {props.data.data.hcl.open}
        </div>
    )
}

export default Graphh
